import React from "react";
import Navigation from "./components/Navigation";
import Trade from "./components/Trade";

const Trades = () => {
  return (
    <div>
      <div className="navigation-home">
        <Navigation />
      </div>
      <div className="trade">
        <Trade />
      </div>
      {/* Watchlist */}
      {/* Plan */}
      {/* Summary */}
    </div>
  );
};

export default Trades;
